DROP TABLE IF EXISTS `product_category`;
CREATE TABLE `product_category` (
  `category_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '产品分类编号',
  `parent_id` int(11) NOT NULL DEFAULT '0' COMMENT '支付渠道编号',
  `category_name` char(30) NOT NULL COMMENT '分类名称',
  `is_default` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否是默认分类(1、是；0、否)',
  `is_show` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否显示(1、显示；0、隐藏)',
  `is_delete` int(3) NOT NULL DEFAULT '0' COMMENT '是否删除',
  `enabled` tinyint(1) NOT NULL DEFAULT '1' COMMENT '型类状态(0、删除；4、开通；1、暂停；)',
  `sort_order` tinyint(3) NOT NULL COMMENT '备注',
  `identify` varchar(20) NOT NULL DEFAULT '',
  PRIMARY KEY (`category_id`)
) ENGINE=MyISAM AUTO_INCREMENT=15 DEFAULT CHARSET=utf8 COMMENT='产品分类';

