-- Table structure for products
-- ----------------------------
DROP TABLE IF EXISTS `products`;
CREATE TABLE `products` (
  `product_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '产品ID',
  `channel_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '支付渠道编号',
  `class_id` int(10) unsigned NOT NULL DEFAULT '0',
  `channel_product_id` varchar(20) NOT NULL DEFAULT '' COMMENT '产品渠道编号',
  `product_name` char(60) NOT NULL DEFAULT '' COMMENT '产品名称',
  `product_price` float(6,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '产品价格',
  `product_discount_rate` decimal(3,2) unsigned NOT NULL DEFAULT '1.00' COMMENT '折扣',
  `product_discount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '可惠优价格',
  `product_description` text COMMENT '产品描述',
  `product_tips` varchar(255) NOT NULL DEFAULT '' COMMENT '提示信息',
  `is_default` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否是默认产品',
  `is_show` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `product_rank` int(3) unsigned NOT NULL DEFAULT '255' COMMENT '产品排序',
  `product_attribute` varchar(200) NOT NULL DEFAULT '' COMMENT '产品属性',
  `product_status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '产品状态(0、删除；4、开通；1、暂停)',
  `is_other` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否在其它中显示(1、是；0、否；)',
  `dateline` int(10) unsigned NOT NULL DEFAULT '0',
  `lasttime` int(10) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`product_id`)
) ENGINE=MyISAM AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 COMMENT='产品';

